WorkflowProcessEvent.eventDescription:
function afterTaskComplete(colleagueId,nextSequenceId,userList){
	
	var sequenceId = getValue("WKNumState");
	var numEmpresa = getValue("WKCompany");
	var numProcesso = getValue("WKNumProces");
	var numThread = hAPI.getActualThread(numEmpresa, numProcesso, sequenceId);
	var colleagueId = getValue("WKUser");	
	
	if (sequenceId == 0 || sequenceId == 1) hAPI.setTaskComments(colleagueId, numProcesso,  numThread, hAPI.getCardValue("narrativaNF"));
	
	if (sequenceId == 3) hAPI.setTaskComments(colleagueId, numProcesso,  numThread, hAPI.getCardValue("desc_analista"));
			
	if (sequenceId == 11)  hAPI.setTaskComments(colleagueId, numProcesso,  numThread, hAPI.getCardValue("desc_contratante"));
		
	if (sequenceId == 38)  hAPI.setTaskComments(colleagueId, numProcesso,  numThread, hAPI.getCardValue("desc_cancelamento")); 
	
	if (sequenceId == 48) hAPI.setTaskComments(colleagueId, numProcesso,  numThread, hAPI.getCardValue("desc_checkDados")); 

	if (sequenceId == 52) hAPI.setTaskComments(colleagueId, numProcesso,  numThread, hAPI.getCardValue("desc_aprov_checkDados")); 

	if (sequenceId == 59) hAPI.setTaskComments(colleagueId, numProcesso,  numThread, hAPI.getCardValue("desc_aprov_final")); 

	if (sequenceId == 29) hAPI.setTaskComments(colleagueId, numProcesso,  numThread, hAPI.getCardValue("desc_lancDatasul"));
	
	
}

function beforeCancelProcess(colleagueId,processId){
	var process;
	var cardData = new java.util.HashMap();
	
	//Monta as constraints para consulta
    var c1 = DatasetFactory.createConstraint("processId", "CTe", "CTe", ConstraintType.MUST);
    var c2 = DatasetFactory.createConstraint("active", "true", "true", ConstraintType.MUST);
    var constraints   = new Array(c1, c2);
    
    //Define os campos para ordenação
    var sortingFields = new Array("workflowProcessPK.processInstanceId");
     
    //Busca o dataset
    var dataset = DatasetFactory.getDataset("workflowProcess", null, constraints, sortingFields);    
    
    for(var i = 0; i < dataset.rowsCount; i++) {
    	process = dataset.getValue(i, "workflowProcessPK.processInstanceId");	
		cardData = hAPI.getCardData(process);			
		if (hAPI.getCardValue("ChaveCTe")  == cardData.get("ChaveCTe")){
			 throw " Existem mais processos referentes a CTe em aberto, não é possivel cancelar ";			
		}
	}  
	
	
	
}

function beforeTaskSave(colleagueId, nextSequenceId, userList) {
	if (hAPI.listAttachments().size() < 2) {
        throw "    É necessario incluir os arquivos XML e PDF!";
    }
	
	if (nextSequenceId == 45) {
		
		var process;
		var cardData = new java.util.HashMap();
		
		//Monta as constraints para consulta
	    var c1 = DatasetFactory.createConstraint("processId", "CTe", "CTe", ConstraintType.MUST);
	    var c2 = DatasetFactory.createConstraint("active", "true", "true", ConstraintType.MUST);
	    var constraints   = new Array(c1, c2);
	    
	    //Busca o dataset
	    var dataset = DatasetFactory.getDataset("workflowProcess", null, constraints, null);
	    
	    process = 0;
	    for(var i = 0; i < dataset.rowsCount; i++) {
	    	process = dataset.getValue(i, "workflowProcessPK.processInstanceId");	    	
	    	cardData = hAPI.getCardData(process);			
			if (hAPI.getCardValue("ChaveCTe")  == cardData.get("ChaveCTe") && process != getValue("WKNumProces")){
				var cc1 = DatasetFactory.createConstraint("processHistoryPK.processInstanceId", process, process, ConstraintType.MUST);
			    var cc2 = DatasetFactory.createConstraint("active", "true", "true", ConstraintType.MUST);
			    var cconstraints   = new Array(cc1, cc2);
			    
			    var subDataset = DatasetFactory.getDataset("processHistory", null, cconstraints, null);
			    for(var j = 0; j < subDataset.rowsCount; j++) {
			    	if (subDataset.getValue(j, "stateSequence") != 29 && subDataset.getValue(j, "stateSequence") != 45) throw "<br/>Ainda não é possivel enviar este processo para a proxima etapa! </br>Aguardando o processo: " + process;			    
			    }			
				
			}
		}
	}
	

	if (nextSequenceId == 74) {
		
		var process;
		var cardData = new java.util.HashMap();
		
		//Monta as constraints para consulta
	    var c1 = DatasetFactory.createConstraint("processId", "CTe", "CTe", ConstraintType.MUST);
	    var c2 = DatasetFactory.createConstraint("active", "true", "true", ConstraintType.MUST);
	    var constraints   = new Array(c1, c2);
	    
	    //Busca o dataset
	    var dataset = DatasetFactory.getDataset("workflowProcess", null, constraints, null);
	    
	    process = 0;
	    for(var i = 0; i < dataset.rowsCount; i++) {
	    	process = dataset.getValue(i, "workflowProcessPK.processInstanceId");	    	
	    	cardData = hAPI.getCardData(process);			
			if (hAPI.getCardValue("ChaveCTe")  == cardData.get("ChaveCTe") && process != getValue("WKNumProces")){
				var cc1 = DatasetFactory.createConstraint("processHistoryPK.processInstanceId", process, process, ConstraintType.MUST);
			    var cc2 = DatasetFactory.createConstraint("active", "true", "true", ConstraintType.MUST);
			    var cconstraints   = new Array(cc1, cc2);
			    
			    var subDataset = DatasetFactory.getDataset("processHistory", null, cconstraints, null);
			    for(var j = 0; j < subDataset.rowsCount; j++) {
			    	if (subDataset.getValue(j, "stateSequence") != 3 && subDataset.getValue(j, "stateSequence") != 11) {
			    		if (cardData.get("aprov_contratante") != hAPI.getCardValue("aprov_contratante"))
			    			throw "<br/>A decisão desta tarefa difere do processo " + process + " que contem o mesmo CTe e <strong>" + cardData.get("aprov_contratante") + "</strong> foi aprovado";			    
			    	}
			    }			
				
			}
		}
	}
}

function beforeStateLeave(sequenceId){
	
	if (sequenceId == 29) {
		var calendar = java.util.Calendar.getInstance().getTime();
        var docs = hAPI.listAttachments();
        for (var i = 0; i < docs.size(); i++) {
            var doc = docs.get(i);
            
            if (doc.getDocumentType() != "7") {continue;}
             
            var ext = doc.getDocumentDescription().substring(doc.getDocumentDescription().lastIndexOf(".")) ;             
           
            doc.setParentDocumentId(10809);
            doc.setDocumentDescription("Processo: " + getValue("WKNumProces") + " - Anexo: " + (i + 1) +  ext );          
            doc.setVersionDescription("Processo: " + getValue("WKNumProces"));
            doc.setAdditionalComments("Processo: " + getValue("WKNumProces") + " - Anexo: " + (i + 1));
            doc.setExpires(false);
            doc.setCreateDate(calendar);
            doc.setValidationStartDate(calendar);
            
            doc.setInheritSecurity(true);
            doc.setTopicId(1);
            doc.setUserNotify(false);
            
            doc.setVersionOption("0");
            doc.setImutable(false);
            doc.setUpdateIsoProperties(true);
            try { 
            	hAPI.publishWorkflowAttachment(doc);
            } catch (e) {
        		log.error("----------------ERRO:");
        		log.error(e);
        	}
        }
        
    }
	
	if (sequenceId == 82) {
		var process;
		var auxObs = "";
		var cardData = new java.util.HashMap();
		
		//Monta as constraints para consulta
	    var c1 = DatasetFactory.createConstraint("processId", "CTe", "CTe", ConstraintType.MUST);
	    var c2 = DatasetFactory.createConstraint("active", "true", "true", ConstraintType.MUST);
	    var constraints   = new Array(c1, c2);
	    
	    //Define os campos para ordenação
	    var sortingFields = new Array("workflowProcessPK.processInstanceId");
	     
	    //Busca o dataset
	    var dataset = DatasetFactory.getDataset("workflowProcess", null, constraints, sortingFields);
	    
	    process = 0;
	    for(var i = 0; i < dataset.rowsCount; i++) {
	    	process = dataset.getValue(i, "workflowProcessPK.processInstanceId");	    	
	    	cardData = hAPI.getCardData(process);			
			if (hAPI.getCardValue("ChaveCTe")  == cardData.get("ChaveCTe") && process != getValue("WKNumProces")){
				auxObs = auxObs + "- Nota Fiscal: " + cardData.get("nrNota") + " no fluxo: " + process + "\n";
			}
		}
	    if (auxObs != "") hAPI.setCardValue("narrativaNF", hAPI.getCardValue("narrativaNF") + "\n\nEste CTe também contem:\n" + auxObs);
	    hAPI.setCardValue("num_processo", getValue("WKNumProces"));
	}	
	
	
}
